import React, { useState } from 'react';
import DataTable from '../DataTable/dataTable';
import eventsData from './eventsData.json';
import SearchBar from './SearchBar'; // Import the SearchBar component
import '../DataTable/tableStyle.css';

function Events() {
  const [filteredData, setFilteredData] = useState(eventsData);

  const handleSearch = (searchText) => {
    const newData = eventsData.filter((item) => {
      // Implement your filtering logic here
      return true; // Placeholder return for now
    });
    setFilteredData(newData);
  };

  return (
    <section id="events">
      <h1>Upcoming Events</h1>
      {/* Render the SearchBar component */}
      <SearchBar onSearch={handleSearch} />
      {/* Render the DataTable component with filtered data */}
      <DataTable data={filteredData} />
    </section>
  );
}

export default Events;
